css:
@-moz-document domain("facebook.com") {
#blueBar {
background: -webkit-gradient( linear, left top, left bottom, from( #738ABA), to( #2C4987) );
width: 1300px;
-webkit-box-shadow: inset 0 1px 1px -1px 
white;
-webkit-border-radius: 0px 0px 10px 10px;
border-radius: 0px 0px 10px 10px;
margin: auto;
}

.slim #blueBar {
-webkit-box-shadow: 0 2px 30px -2px 
rgba(0, 0, 0, .52);
height: 37px;
}

body {
background: 
white;
font-size: 11px;
font-family: "lucida grande",tahoma,verdana,arial,sans-serif;
color: 
#333;
line-height: 1.28;
margin: 0;
padding: 0;
text-align: left;
direction: ltr;
unicode-bidi: embed;
background-image: url(data:image/png;base64,);
}

#contentCol {
background-color: 
white;
background-image: url(data:image/png;base64,);
padding-top: 15px;
}

.timelineLayout {
background: 
black;
background-image: url(data:image/png;base64,);
}

.fbTimelineScrubber {
background-color: 
black;
padding: 8px 0 8px 1px;
top: 38px;
width: 122px;
z-index: 1;
background-image: url(data:image/png;base64,);
}

.fbTimelineTimePeriod {
background: 
#333 url(data:image/png;base64,);
-webkit-border-radius: 20px;
border-radius: 20px;
}

.fbTimelineTopSectionBase .topSectionBottomBorder {
display: none;
}

.timelineLayout .fbTimelineTopSection {
padding: 0;
margin: 0;
-webkit-border-radius: 20px;
border-radius: 20px;
}

#blueBar #pageHead {
margin: 0 auto;
padding-top: 0px;
width: 1024px;
border: solid 1px;
-webkit-border-radius: 4px;
-webkit-box-sizing: border-box;
border-color: 
#2A3349 
#2A3A64 
#253662;
-webkit-box-shadow: inset 0 1px 1px 
rgba(0, 0, 0, .21), 0 1px 0 
rgba(255, 255, 255, .17);
background: -webkit-gradient( linear, left top, left bottom, from( 
#647AAB), to( 
#2C467E) );
margin-top: 3px;
height: 32px;
}

#navSearch {
margin: 3px 0 0 60px;
position: relative;
width: 350px;
}

.uiSideNav .item, .uiSideNav .subitem {
color: 
#333;
display: block;
border-bottom: 1px solid 
transparent;
min-height: 17px;
line-height: 13px;
padding: 3px 8px 0 28px;
text-decoration: none;
}

.uiUfi .ufiItem {
background-color: 
rgba(0, 0, 0, 0.1);
margin-top: 1px;
padding: 5px 5px 4px;
}

.uiStream .uiStreamHeader .uiStreamHeaderChronologicalForm, .uiStream .uiStreamHeader .uiStreamHeaderText {
background-color: transparent;
}

.uiStream .shareRedesignText, .uiStream .shareRedesignContainer, .uiStream .shareRedesign .shareMediaVideo {
background-color: rgba(0, 0, 0, 0.1);
}

img {
border: 0;
-webkit-border-radius: 5px;
-webkit-box-shadow: 0px 0px 3px 2px 
white;
box-shadow: 0px 0px 3px 2px 
white;
}

.uiHeaderSection, .uiSideHeader {
background-color: rgba(0, 0, 0, 0.1);
}

#pagelet_composer {
background: -webkit-gradient( linear, left top, left bottom, from( 
#738ABA), to( 
#2C4987) );
-webkit-box-shadow: 0 2px 30px -2px 
rgba(0, 0, 0, .52);
-webkit-border-radius: 10px 10px 10px 10px;
border-radius: 0px 0px 10px 10px;
padding: 5px 10px 5px 10px;
margin-bottom: 20px;
position: fixed;
margin-left: -112px;
margin-top: -5px;
width: 500px;
z-index: 299;
}

#pagelet_home_stream {
margin-top: 95px;
}

span.uiComposerAttachment {
color: white;
}

span.uiComposerAttachment a {
color: #333;
}

#leftCol {
float: left;
word-wrap: break-word;
background: -webkit-gradient( linear, left top, left bottom, from( 
#738ABA), to( 
#2C4987) );
-webkit-box-shadow: 0 2px 30px -2px 
rgba(0, 0, 0, .52);
-webkit-border-radius: 10px 10px 10px 10px;
border-radius: 0px 0px 10px 10px;
padding: 0px 10px 0px 10px;
margin-bottom: 20px;
position: fixed;
margin-left: -159px;
margin-top: -8px;
width: 210px;
z-index: 299;
}

.navHeader, .navHeader a {
color: white;
}

.uiSideNav .item, .uiSideNav .subitem {
color: 
white;
line-height: 13px;
}

.uiSideNav .selectedItem .item, .uiSideNav .selectedItem .item:hover, .uiSideNav ul .selectedItem .subitem, .uiSideNav ul .selectedItem .subitem:hover {
background-color: 
rgba(0, 0, 0, 0.3);
font-weight: bold;
}

#pagelet_welcome_box {
display: none;
}


}
